  "fixed_xml": "<ITEM>3. Herr Johann Heinrich Flick, Buchbinder an der Gerberga\u007f\u0000c3\u0000bc bey E. E. Zunfft zu Schneideren, thut hiemit allen denen Herren Liebhaberen zu wissen, die noch willens und auf diejenige Bibel zu praenumeriren, welche <BIBL><AUTHOR>Herr Johannes Amman</AUTHOR> Kupfferstecher in <PLACE>Schaffhausen</PLACE> in <FORMAT>Quarto</FORMAT> drucken l\u007f\u0000a7\u007f\u0000fc\u0000fct, mit sch\u007f\u0000b2nem grobem Druck und <VOLUME>180.</VOLUME> Kupfferstichen, da\u007f\u0000c3\u0000bc deren Praenumerations-Termin in n\u007f\u0000a7chstk\u007f\u0000bnfftigem Monath May zu Ende gehe, und so dann in dem Praenumerations-Prti\u007f\u0000fc keine mehr zu haben seyen, wer also Lust hat dieses sch\u007f\u0000b2ne und nutzliche Werck sich in solch extra wohlseilem Prei\u007f\u0000c3\u0000bc anzuschaffen, beliebe sich bey Zeiten bey ihme anzumelden, und das Praenumerations- Geld einzusenden, das Exemplar kostet, auf Schreib-Pappier <PRIZE>fl. 1. 30. xr.</PRIZE> avon <PRIZE>1. fl.</PRIZE> zum Voraus und <PRIZE>30. xr.</PRIZE> bey Empfang der Bibel, auf sauber Druck-Pappier aber <PRIZE>fl. 1. 12. xr.</PRIZE> davon <PRIZE>36. xr.</PRIZE> zum Voraus und <PRIZE>36. xr.</PRIZE> bey deren Empfang bezahlet wird; und stellet er so dann seinen Herren Poaenumeranten frey ihre Exemplaria gebunden oder ungebunden bey ihme zu beziehen. Die weiteren Umst\u007f\u0000a7nde und sch\u007f\u0000b2ne Disposition dieser Bibel, ist aus dem Prob-Bogen, so bey ihme zu haben, mit mehrerm zu sehen.</BIBL></ITEM>",
